import * as React from "react";
import "./mock";
import * as Ant from "antd";
import 'antd/dist/antd.css';

function App() {
  const [datasource, setDataSource] = React.useState([
    {
      key: 1,
      State: 'state',
      City: 'city',
      Houses: 'Houses',
      "Avg. Price": 'Avg. Price',
    }
  ]);
  const [isLoading, setIsLoading] = React.useState(true);
  const columns = [
    {
      title: "State",
      dataIndex: "State",
      key: "State"
    },
    {
      title: "City",
      dataIndex: "City",
      key: "City"
    },
    {
      title: "Houses",
      dataIndex: "Houses",
      key: "Houses"
    },
    {
      title: "Avg. Price",
      dataIndex: "Avg. Price",
      key: "Avg. Price"
    }
  ]

  React.useEffect(() => {
    fetch("/api/properties")
      .then(res => res.json())
      .then(
        (result) => {
          // console.log(result);
          let filter = result?.data.filter((element) => {
            return element?.state === 'Georgia';
          });
          let reduce = filter?.reduce((obj, item) => {
            console.log(obj, item)
            obj[item] = obj[item] ? obj[item] +1 : 1;
            return obj;
          }, {})
          console.log(reduce);
          // setDataSource(result);
          setIsLoading(false);
        },
        (error) => {
          console.log(error);
          setIsLoading(false);
        }
      )
  });


  return (
    <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center', width: '100vw', height: '100vh'}}>
    {isLoading ?
      <Ant.Spin size="large" tip="Loading.."/>
      :
      <Ant.Table dataSource={datasource} columns={columns} />
    }
    </div>
  );
}


export default App;
